UNION
SELECT inv.INVESTIGATION_KEY, RPT_SRC_ORG_KEY,INV_LOCAL_ID AS INVESTIGATION_LOCAL_ID,CONDITION_KEY, JURISDICTION_NM AS JURISDICTION_NAME, PATIENT_key, PHYSICIAN_KEY FROM RDB.dbo.INVESTIGATION inv with ( nolock) LEFT OUTER JOIN RDB.dbo.CASE_COUNT cc with ( nolock) ON inv.INVESTIGATION_KEY =cc.INVESTIGATION_KEY WHERE CASE_TYPE='I' and inv.INVESTIGATION_KEY in ( select [INVESTIGATION_KEY] FROM rdb.dbo.TEMP_UPDATED_LAB_INV_MAP with ( nolock))
