union SELECT inv.INVESTIGATION_KEY, RPT_SRC_ORG_KEY,INV_LOCAL_ID AS INVESTIGATION_LOCAL_ID,CONDITION_KEY, JURISDICTION_NM AS JURISDICTION_NAME, PATIENT_key, PHYSICIAN_KEY FROM RDB.dbo.INVESTIGATION inv with ( nolock) LEFT OUTER JOIN RDB.dbo.CASE_COUNT cc with ( nolock) ON inv.INVESTIGATION_KEY =cc.INVESTIGATION_KEY WHERE CASE_TYPE='I' and cc.patient_key in (select patient_key from rdb.dbo.d_patient where PATIENT_LAST_CHANGE_TIME >= '2023-03-13 00:00:00' and PATIENT_LAST_CHANGE_TIME < '2023-06-01 00:00:00' group by PATIENT_LOCAL_ID,patient_key) ;
